(1, 'terms', '<p>CHECKING THAT TERMS &amp; CONDITIONS ARE WORKING ARE <strong>NOT</strong></p><p>&nbsp;</p><p>&nbsp;</p>', NULL, NULL),
(2, 'policy', '<center><h3><strong>Privacy Policy</strong></h3></center><p>Privacy Policy for \"<i><strong>Rudra Connect App</strong></i>\" at Rudra Corporate Services, one of the main priorities is the privacy of visitors.</p><p>The Privacy Policy Document Contains types of information that is collected and recorded by Rudra Corporate Services and how we use it.</p><p><strong>Information We Collect</strong></p><p>Log Files Rudra Corporate Services follows a standard procedure of using log files. These files log visitors when they use the app. &nbsp;</p><p>The information collected by log files includes Internet Protocol (IP) addresses, browser type, Internet Service Provider (ISP), date and time stamp, aanonymous usage data, the general demographic information we may collect, referring/exit pages and URLs, platform types, preferences you submit, and preferences that are generated based on the data you submit and the number of clicks.</p><p><strong>Use Of Information</strong></p><p>Except as otherwise stated in this Privacy Policy, we do not sell, trade, rent, or otherwise share for marketing purposes your Personal Information with third parties without your consent. Your information, whether public or private, will not be sold, exchanged, transferred, or given to any other company for any reason whatsoever, without your consent, other than for the express purpose of delivering the purchased product or service requested.</p><p><strong>Any of the information we collect from you may be used in one of the following ways:</strong></p><p>1. to contact users in response to questions, solicit feedback from users, provide technical support, and inform users about promotional offers.</p><p>2. To aggregate Non-Personal Information in order to track trends and analyze usage patterns on the Site.</p><p>3. To improve our website based on the information and feedback we receive from you.</p><p>4. To improve customer service and personalize your experience.</p><p>5. To administer a contest, promotion, or survey.</p><p>6. To send periodic emails for system communication purposes. The email address you provide for order processing may be used to send you information and updates pertaining to your order, in addition to receiving occasional company news, updates, and related product or service information.</p><p><strong>GPS Tracking</strong></p><p>Powerful GPS trail feature allows the Operation team to seamlessly track the movements of a guard on duty. It sends automatic alerts when the security officer stresses away from the designated route. The tech empowers clients to stay up to date on the security arrangements at their site. Creating location-centric reports, it cuts down on costs and raises the level of patrol efficiency. GPS trailing can also be used as proactive maintenance and save money on unintentional mishandling.</p><p><strong>\"Rudra Connect App</strong>\" collects location data to track the security Guards Live Location Continiously, So even when the app is closed or not in use the App runs on background &nbsp;once it is logged in.</p><p><strong>Advertising Policies</strong></p><p>Our Advertising partners some&nbsp;of the advertisers in our App may use cookies and web beacons. &nbsp;Each of our advertising partners has its own Privacy Policy for their policies on user data.</p><p>In addition to the information provided automatically by your browser when you visit the Site to become a subscriber to the Service, you will need to create a personal profile. You can create a profile by registering with the Service and entering your name, email address, phone number, and password. By registering, you are authorizing us to collect, store and use your information in accordance with this Privacy Policy</p><p>For Easier access, we hyperlinked to their Privacy Policy below. &nbsp; Google <a href=\"https://policies.google.com/technologies/ads\">https://policies.google.com/technologies/ads</a> Privacy Policies you may consult this list to find the Privacy Policy for each of the advertising partners of Rudra Corporate Services. &nbsp;Third-party ad servers or ad networks use technologies like cookies, JavaScript, or Beacons that are used in their respective advertisements and links that appear on Rudra Corporate Services. &nbsp;They automatically received your IP address when this occurs. &nbsp;These technologies are used to measure the effectiveness of their advertising campaigns and/or to personalize the advertising content that you see on this app or other apps or websites. &nbsp;Thus, we are advising you to consult the respective Privacy Policies of these third-party ad servers for more detailed information. &nbsp;It may include their practices and instructions about how to opt-out of certain options. &nbsp;Children\'s information another part of our priority is adding protection for children while using the internet. &nbsp;We encourage parents and guardians to observe, participate in, and/or monitor and guide their online activity. &nbsp;Rudra Corporate Services does not knowingly collect any Personal Identifiable Information from children under the age of 13. &nbsp;If you think that your child provided this kind of information on Our App, we strongly encourage you to contact us immediately and we will do our best efforts to promptly remove such information from our records. &nbsp;Online Privacy Policy Only this Privacy Policy applies only to Our Online activities and is valid for visitors to Our App with regards to the information that they share and/or collect in Rudra Corporate Services. &nbsp;This Policy is not applicable to any information collected offline via channels other than this app. &nbsp;Consent by Using Our app, you hereby consent to our Privacy Policy and agree to its Terms and Conditions.</p><p>Changes To Our Privacy Policy</p><p>The Company reserves the right to change this policy and our Terms of Service at any time. We will notify you of significant changes to our Privacy Policy by sending a notice to the primary email address specified in your account or by placing a prominent notice on our site. Significant changes will go into effect 30 days following such notification. Non-material changes or clarifications will take effect immediately. You should periodically check the Site and this privacy page for updates.</p><p><br>If you have additional questions or require more information about Our Privacy Policy, do not hesitate to contact us.</p><p>&nbsp;</p>', NULL, NULL),
