(6, 'about', '<p>OUR VISION<br>To become the preferred manpower and security services provider in India by creating a difference in the levels of service through deployment of manpower with Right skills at Right place in Right Time.</p><p>OUR MISSION<br>Our mission is to create truly satisfied Client\'s by providing the services at reasonably affordable prices with good ethics and corporate social responsibility.<br>Rudra Corporate Services Mission is to provide our clients with the finest Services available in the marketplace. Through our extensive complement of high quality Services, we will enable our valuable clients to run their operations with minimal effort and concern for their safety and security. We will provide the very best in quality which, in no uncertain terms, means investing heavily into the selection, support, supervision and personal development of our people. We will develop the most responsive Client\'s service programs in the industry by creating strong lines of communication and by investing in leading edge technology that adds value to our Client\'s</p><p>&nbsp;</p><p>&nbsp;</p>', NULL, NULL);
